import React from 'react';
import './Critter.css'

const labelStyle = css`
    font-size: 20px;
    color: green;
    margin-right: 65px;
`;

export const Critter = (props) => {
    return (
        <div className="critter">
            <img src={props.imgUri} alt="img"></img>
            <p css={labelStyle}>{props.label}</p>
        </div>
    )
}
